function createDom(text) {

    const div = document.createElement('div')
    
    const img = document.createElement('img')

    img.src = '/three-editor/dist/site.png'

    img.style.width = '50px'

    img.style.height = '50px'

    div.appendChild(img)

    div.innerHTML += text

    div.style.color = 'white'

    return div

}
